import React from "react";
import Python from "../images/python.jpeg";
import C from "../images/c++.png";
import Htm from "../images/html.png";
import Css from "../images/css.png";
import Bootstrap from "../images/bootstrap.png";
import Js from "../images/js.png";
import Rea from "../images/react.png";
import Tailwind from "../images/tailwind.jpg";
import MongoDb from "../images/mongodb.webp";
import Njs from "../images/njs.png";
import Firebase from "../images/firebase.webp";

const main = () => {
  return (
    <div className=" h-[60vh] bg-white ">
      <div className="flex justify-center">
        <h1 className="text-4xl py-8 font-bold">SKILLS</h1>
      </div>
      <div className="flex flex-col justify-center">
        <div className="flex justify-evenly">
          <div className="flex flex-col justify-center">
          <img className="w-20 rounded-3xl" src={Python} alt="" /> <span> Python</span>
          </div>
          <div>
          <img className="w-20 rounded-3xl" src={C} alt="" /> <span>C++</span>
          </div>
          <div>
          <img className="w-20 rounded-3xl" src={Js} alt="" /> <span></span>
          </div>
          <img className="w-20 rounded-3xl" src={Htm} alt="" /> <span></span>
          <img className="w-20 rounded-3xl" src={Css} alt="" /> <span></span>
          <img className="w-20 rounded-3xl" src={Js} alt="" /> <span></span>
        </div>
        <div className="flex justify-evenly mt-28">
          <img className="w-24 rounded-3xl" src={Rea} alt="" /><span></span>
          <img className="w-24 rounded-3xl" src={Bootstrap} alt="" /><span></span>
          <img className="w-28 rounded-3xl" src={Njs} alt="" /><span></span>
          <img className="w-28 rounded-3xl" src={MongoDb} alt="" /><span></span>
          <img className="w-28 rounded-3xl" src={Firebase} alt="" /><span></span>
        </div>
      </div>
    </div>
  );
};

export default main;
